import React, { Component } from "react";
import { w3cwebsocket as W3CWebSocket } from "websocket";


const msg = { "topic": "subscribe", "to": "EURUSD:CUR" }
const JSONmsg = JSON.stringify({ "topic": "subscribe", "to": "EURUSD:CUR" })
const client = new W3CWebSocket(
  `ws://stream.tradingeconomics.com/?client=guest:guest`
);

class EURUSDrate extends Component {

  componentWillMount() {
    client.onopen = () => {
      console.log("WebSocket Client Connected");
    };

    client.onopen = (event) => {
        const results = client.send(JSONmsg)
        console.log(results)
    }
        client.onmessage = (event) => {
        console.log(event.data);
    };
  }

  render() {
